import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import MCQ from './mcq'; // Importing the MCQ component
import './App.css';

function handleSmoothScroll(event) {
  event.preventDefault();
  const targetId = event.currentTarget.getAttribute("href").slice(1); // Remove the "#" from the href
  const targetElement = document.getElementById(targetId);

  if (targetElement) {
    targetElement.scrollIntoView({
      behavior: "smooth",
      block: "start",
    });
  }
}

function App() {
  const [selectedCourse, setSelectedCourse] = useState(null);

  const handleDropdownChange = (event) => {
    setSelectedCourse(event.target.value);
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div>
              {/* Navbar */}
              <nav className="navbar" id="navbar">
                <div className="logo">EduTech</div>
                <ul className="nav-links">
                  <li>
                    <a href="#home" onClick={handleSmoothScroll}>
                      Home
                    </a>
                  </li>
                  <li>
                    <a href="#courses" onClick={handleSmoothScroll}>
                      Course
                    </a>
                  </li>
                  <li>
                    <a href="#about-us" onClick={handleSmoothScroll}>
                      About Us
                    </a>
                  </li>
                  <li>
                    <a href="#mentor" onClick={handleSmoothScroll}>
                      Mentor
                    </a>
                  </li>
                  <li>
                    <Link to="/mcq" className="login-button">
                      MCQ Page
                    </Link>
                  </li>
                </ul>
              </nav>

              {/* Tagline Section */}
              <div className="tagline" id="home">
                <div className="tagline-content">
                  <h1 className="tagline-title">
                    <span className="tagline-red">Empower</span> Your Learning{" "}
                    <span className="tagline-red">Journey</span>
                  </h1>
                  <p className="tagline-subtitle">
                    Unlock your potential with our expertly crafted courses
                  </p>
                  <button className="explore-button">Explore Courses</button>
                </div>
              </div>

              {/* Cards Section */}
              <div className="card-container" id="courses">
                <div className="card">
                  <img
                    src={`${process.env.PUBLIC_URL}/images/system.gif`}
                    alt="System Design"
                    className="card-img"
                  />
                  <h3>GATE</h3>
                  <p>Learn how to design scalable systems.</p>

                  {/* Dropdown added here */}
                  <select
                    value={selectedCourse}
                    onChange={handleDropdownChange}
                    className="course-dropdown"
                  >
                    <option value="">Select Course</option>
                    <option value="GATE MCQ's">GATE MCQ's</option>
                    <option value="GATE Notes">GATE Notes</option>
                  </select>
                </div>
                {/* Repeat other cards as needed */}
              </div>

              {/* Why Choose Us Section */}
              <div className="why-choose-us" id="about-us">
                <h1>
                  Why Choose Us <span className="tagline-red">?</span>{" "}
                </h1>
                <h3>
                  Unlock Your Potential with Our Comprehensive Learning Approach
                </h3>
                <div className="reasons-container">
                  <div className="reason-card" id="educational">
                    <h2>01</h2>
                    <h3>Expert Instructors</h3>
                    <p>
                      Our courses are taught by industry experts with years of
                      experience.
                    </p>
                  </div>
                  {/* Repeat other cards */}
                </div>
              </div>

              <footer>
                {/* Footer content */}
              </footer>
            </div>
          }
        />
        <Route path="/mcq" element={<MCQ />} />
      </Routes>
    </Router>
  );
}

export default App;
